chaineADecoder = ""
donnees_binaires = base64.b64decode(chaineADecoder)

img = Image.open(BytesIO(donnees_binaires)) # Création d'un objet Image à partir des données binaires
# image.show() # Affichage de l'image
texte_captcha = pytesseract.image_to_string(img) # Utiliser Tesseract pour OCR
print("Texte du captcha:", texte_captcha)